import React from 'react';
import './App.css';
import Logo from './images/Logo.png'
function Nav() {
    return(
        <nav>
               <img src={Logo} className="logo"></img>
           <ul className="nav-links">
               <Link to = '/Page_Principale'>
                <li>Main Page</li>
                </Link>
                <Link  to = '/Page_Admin'>
                <li>Admin Page</li>
                </Link>
            </ul> 
        </nav>
    );
}

export default Nav;
